import React, {Suspense} from 'react';
const Upload = React.lazy(()=>import('./upload/Upload'));
const About = React.lazy(()=>import('./about/About'));
const JsonFile = React.lazy(()=>import('./export/JsonFile'));
const Header = React.lazy(()=>import('./header/Header'));
const Main = React.lazy(()=>import('./main/Main'));
const Schemas = React.lazy(()=>import('./schemas/Schemas'));
const Server = React.lazy(()=>import('./server/Server'));
const Security = React.lazy(()=>import('./security/Security'));
const Tags = React.lazy(()=>import('./tags/Tags'));
const Wizards = React.lazy(()=>import('./wizards/Wizards'));
const YmlFile = React.lazy(()=>import('./export/YmlFile'));



const SelectionTab = ({selected}) => {
    const obj = {
        home: <About/>,
        upload: <Upload/>,
        header: <Header/>,
        servers: <Server/>,
        security: <Security/>,
        tags: <Tags/>,
        main: <Main/>,
        schemas: <Schemas/>,
        wizards: <Wizards/>,
        exports: <JsonFile/>,
    }
    const selectedComponent = obj[selected];

    return (
        <div>
            <Suspense fallback={<div>Loading...</div>}>
              {selectedComponent}
            </Suspense>
        </div>
    )
}
export default SelectionTab;
